    false,nt"url": null,nt"notes": "NODC accession 0089634 includes physical
    and underway data collected aboard the ROGER REVELLE during cruise RR1004 in the
    Philippine Sea and South China Sea (Nan Hai) from 2010-04-06 to 2010-04-07. These
    data include CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH
    COMPONENT (V). The instruments used to collect these data include ADCP and GPS.
    These data were collected by Ren-Chieh Lien of UNIVERSITY OF WASHINGTON and SCRIPPS
    INSTITUTION OF OCEANOGRAPHY as part of Process Study of Oceanic Responses to Typhoons
    using Arrays of EM-APEX Floats and Moorings. The Lamont-Doherty Earth Observatory
    (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling Deck to
    Repository (R2R) program. The ADCP data represent the raw and automated processed
    data set. Post processed quality assessed data are not available in this accession.",nt"owner_org":
